body:
我自己参照duee1.0中event_schema.json事件模板构建自己的事件模版，例如
{"event_type": "移动-出行", "role_list": [{"role": "主体"}, {"role": "活动名称"}, {"role": "开始时间"}, {"role": "结束时间"}, {"role": "地点"}], "class": "移动"}  
{"event_type": "交流-访问", "role_list": [{"role": "访问者"}, {"role": "被访问者"}, {"role": "活动名称"}, {"role": "时间"}, {"role": "地点"}], "class": "交流"}
使用的句子文本是都是长度小于300的短文本，大部分的长度都小于200。**但是**我在构建数据集的时候不是完全按照duee1.0中把事件类型"event-trigger"中的trigger作为唯一的触发词。具体来说，在duee1.0的 _"event_type": "交往-点赞"_  中是把"点赞"作为该"交往-点赞"事件的唯一触发词，但是我在构建事件 _"event_type": "移动-出行"_ 数据集的时候，不仅把"出行"最为该事件的触发词，而且把诸如“到达”，“来到”，“去”等与 **“出行”** 含义相似的词都作为事件 _"event_type": "移动-出行"_ 的触发词了。
按照这种构建数据集的方式，我具体 **构建了5种事件类型，总共构建了200条训练样本，使用120条样本作为训练集** 。但是当我做完触发器训练和预测后，发现预测的触发器序列标签是全部是"O" 不能预测出触发词。   我起初以为是模型训练欠拟合，于是特定使用了训练集来做预测，但是预测的结果仍然全部为"O",不能预测出正确的事件触发词。
我列出一个数据样本，
{"text": "当地时间4月15日，德国联邦总理朔尔茨表示，德国愿意为军事援助拨款20亿欧元，而其中大部分将提供给乌克兰。 据悉，此次拨款并不包括在之前德国联邦政府提出的1000亿欧元国防特别预算之内，而是会单独支出", "event_list": [**{"event_type": "交流-表态", "trigger": "表示"**, "trigger_start_index": 19, "arguments": [{"argument_start_index": 10, "role": "主体", "argument": "德国联邦总理朔尔茨"}, {"argument_start_index": 49, "role": "对象", "argument": "乌克兰"}, {"argument_start_index": 27, "role": "议题", "argument": "军事援助"}, {"argument_start_index": 0, "role": "时间", "argument": "当地时间4月15日"}], "class": "交流"}]}
在这个例子中，对于 **事件"交流-表态"**,我使用了 **"表示"** 作为触发词。
**我模型训练后，做的触发器预测和事件角色预测得到的模型输出BIO标签，均是全为'O'的序列标签**。
**如能尽快答复，则万分感谢。**
